var divStyle = {
    position: 'fixed',
    left: '0',
    bottom: '0',
    width: '100%',
    backgroundColor: '#222',
    color: 'white',
    textAlign: 'center',
};

function Footer() {
    return (
        <footer className="bg-dark text-center text-lg-start" style={divStyle}>
            <div className="container p-4">
                <div className="row">
                    <div className="col-lg-2 col-md-6 mb-4 mb-md-0 mr-auto">
                        <a href="#" className="nav-link"><h5>About Us</h5></a>
                    </div>

                    <div className="col-lg-2 col-md-6 mb-4 mb-md-0 mr-auto">

                        <a href="#" className="nav-link"><h5>Contact Us</h5></a>
                    </div>
                    <div className="col-lg-1 col-md-6 mb-4 mb-md-0 ml-auto">
                        <IconButton>
                            <FacebookIcon/>
                        </IconButton>
                    </div>
                    <div className="col-lg-1 col-md-6 mb-4 mb-md-0 ml-auto">
                        <IconButton>
                            <FacebookIcon/>
                        </IconButton>

                    </div>
                </div>
            </div>

            <div className="text-center p-3" style={{backgroundColor: "rgba(0, 0, 0, 0.2)"}}>
                Made with &hearts; by Rahul and Pranaw.
            </div>
        </footer>
    );
}
export default Footer;
